    false,nt"url": null,nt"notes": "This model is a preliminary characterization
    of trichloroethene transport in the surficial and Cambrian-Ordovician aquifer systems
    at the Naval Industrial Reserve Ordnance Plant in Fridley, Minnesota. The characterization
    first considered 2001 conditions using a MODFLOW and MT3DMS, followed by an application
    of this 2001 model to 2011 conditions. The U.S. Geological Survey (USGS), in cooperation
    with the U.S. Department of the Navy, used the steady-state, uniform-density groundwater
    flow model MODFLOW to calculate potentiometric heads in aquifer systems on August
    20, 2001; and the single-phase, conservative, non-reactive, miscible transport model
    MT3DMS to calculate trichloroethene concentrations in aquifer systems measured in
    2001.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
